import React, {Component} from 'react';
import {View, Text, StyleSheet, TextInput, TouchableOpacity} from 'react-native';

class Inicio extends Component {
    constructor(){
        super()
        this.state = {
            email: '',
            contraseña: '',
        }
    }

    render(){
        return(
            <View style={styles.container}>
                <Text>Incia </Text>

                <View>
                    <TextInput 
                        placeholder= 'Email'
                        keyboardType= 'email-address'
                        onChangeText={ texto => this.setState({email : texto})}
                        value = {this.state.email}
                    />
                    <TextInput 
                        placeholder= 'Contraseña'
                        keyboardType= 'default'
                        secureTextEntry = {true}
                        onChangeText={ texto => this.setState({contraseña : texto})}
                        value = {this.state.contraseña}
                    />            

                    <TouchableOpacity onPress={ () => this.iniciarUsuario (this.state.email, this.state.contraseña)}>
                        <Text>Ingresar</Text>
                    </TouchableOpacity>

                    <Text onPress={ () => this.props.navigation.navigate ('Inicio')}>¿No tenes una cuenta? Registrate</Text>
                </View>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });

export default Inicio;
